import React from 'react'
import { Button, Card, Badge } from 'react-bootstrap';


function Home() {
  return (
    <div>
      <h1 style={{display: 'flex', alignItems: 'center', justifyContent: 'center'}}>
        Example heading{' '}
        <Badge bg='secondary' as='Button'>
          New
        </Badge>
      </h1>
    </div>
  );
}

export default Home
